import React from "react";
import { Link } from "react-router-dom";
const LandPadItem = (props) => {
    console.log(props.id);
  return (
    <div
      className="card bg-dark text-light my-3 "
      style={{ width: "390px", height: "470px" }}
    >
      <img
        src={props.images}
        className="card-img-top img-fluid"
        alt="..."
        style={{ height: "250px" }}
      />
      <div className="card-body">
        <h5 className="card-title">
          <strong className="text-muted">{props.name}</strong>,{props.full_name}
        </h5>
        <p className="card-text text-start text-muted">
          {props.details.slice(0, 150)}...
        </p>
        <Link
          key={props.id}
          to={`/landpads/${props.id}`}
          className="btn btn-outline-primary"
        >
          Read More
        </Link>
      </div>
    </div>
  );
};
export default LandPadItem;
